import React, { Component } from 'react';

//props: 
// key (id)
//  id
// home
//  away
//  date
//  timezone
//  location
//  stadium      
class EventTab extends Component {
    //in class eventTab
    render() { 
        return (
            <React.Fragment>
                    <div>
                        {this.props.home} 
                        <img src={this.props.homeImg} class="home-img"/>
                        vs 
                        <img src={this.props.awayImg} class="away-img"></img>
                        {this.props.away}
                    </div>

                    <div>{this.props.stadium} | {this.props.location}</div>
                    <div>{this.props.date}  at  {this.props.timezone}</div>

            </React.Fragment>
        );
    }
}

export default EventTab;
